    return (
        <ArrowCreate
            className="arrow"
            from={{
                direction: DIRECTION.BOTTOM,
                node: () => document.getElementById("nodeID1"),
                translation: [0, 0]
            }}
            to={{
                direction: DIRECTION.TOP_LEFT,
                node: () => document.getElementById("nodeID3"),
                translation: [0, 0]
            }}
            head={{
                distance: 0.99,
                size: 10,
            }}
        />
    )
}
